// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "./Company.sol";


contract CompaniesFactory {

    mapping(address => uint256) public companiesLeaderboard;
    event NewCompaniesCreated(address companiesAddress);

    function createCompanies(
        address priceFeed, // AggregatorV3Interface address Polygon Mumbai Testnet PoS: 0xd0D5e3DB44DE05E9F294BB0a3bEEaF030DE24Ada
        address token, // OffSetCarbonToken address
        string memory companyName, // Company name
        string memory companyType, // Company type ( Ex: Company business, NGO, etc... )
        address companyOwner, // Contract owner
        string memory country, // Company country
        uint256 tokenPrice, // OffSetCarbonToken price
        uint256 carbonCreditsEmmiteds, // Carbon credits emmiteds by the company, this value is set by the certifier entity
        string memory logoURI // Company logo on IPFS
    ) public returns (address) {
        Company newCompanies = new Company(
            priceFeed,
            token,
            companyName,
            companyType,
            companyOwner,
            country,
            tokenPrice,
            carbonCreditsEmmiteds,
            logoURI
        );
        emit NewCompaniesCreated(address(newCompanies));
        companiesLeaderboard[address(newCompanies)] = carbonCreditsEmmiteds;
        return address(newCompanies);
    }
}
